import 'package:carousel_slider/carousel_slider.dart';
import 'package:flutter/material.dart';
import 'package:sample_app/Utility/Helper.dart';
import 'package:sample_app/Utility/Utility.dart';
import 'package:sample_app/Model/Picture.dart';

class MainScreen extends StatefulWidget {
  @override
  _MainScreenState createState() => _MainScreenState();
}

class _MainScreenState extends State<MainScreen> {
  DBHelper dbHelper;
  List<Photo> images;
  bool loading=true;
  @override
  void initState() {
    super.initState();
    images = [];
    dbHelper = DBHelper();
    saveImages();
  }

  //This method will save picture to DATABASE
  saveImages()async{

    String imgString1="";
    String imgString2 = "";
    String imgString3 ="";//Utility.base64String(imgFile2.readAsBytesSync());
    String imgString4="";
    String imgString5="";
    String imgString6="";
    Photo photo1 = Photo(0, imgString1);
    Photo photo2 = Photo(1, imgString2);
    Photo photo3 = Photo(2, imgString3);
    Photo photo4 = Photo(3, imgString4);
    Photo photo5 = Photo(4, imgString5);
    Photo photo6 = Photo(5, imgString6);
    await dbHelper.save(photo1);
    await dbHelper.save(photo2);
    await dbHelper.save(photo3);
    await dbHelper.save(photo4);
    await dbHelper.save(photo5);
    await dbHelper.save(photo6);

    getImages();
  }

  getImages() {
    dbHelper.getPhotos().then((imgs) {
      setState(() {
        images.clear();
        images.addAll(imgs);
        loading=false;
      });
    });
  }

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      body: SafeArea(
        child: Container(
          decoration: BoxDecoration(
            gradient: LinearGradient(
              begin: Alignment.topLeft,
              colors: [
                Colors.purpleAccent,
                Colors.indigo,
                Colors.blue,
                Colors.green,
                Colors.red,
                Colors.orange,
                Colors.white
              ]
            )
          ),
          child: loading?Center(child: CircularProgressIndicator(),):
          Padding(
            padding: const EdgeInsets.all(20.0),
            child: Column(
              children: [
                Expanded(
                  flex: 4,
                  child: CarouselSlider(
                    items: [
                      Container(

                        child: Utility.imageFromBase64String(images[0].photo_name),
                      ),
                      Container(

                        child: Utility.imageFromBase64String(images[1].photo_name),
                      ),
                    ],
                    options: CarouselOptions(
                          viewportFraction: 1.0,
                      aspectRatio: 1.25
                    ),
                  )
                ),
                SizedBox(height: 15,),
                Expanded(
                  flex: 3,
                  child: Row(
                    crossAxisAlignment: CrossAxisAlignment.stretch,
                    children: [
                      Expanded(
                        flex:1,
                        child: Container(

                          child: Utility.imageFromBase64String(images[2].photo_name),
                        ),
                      ),
                      SizedBox(width: 15,),
                      Expanded(
                        flex:1,
                        child: Container(

                          child: Utility.imageFromBase64String(images[3].photo_name),
                        ),
                      ),
                    ],
                  )
                ),

                SizedBox(height: 15,),

                Expanded(
                    flex: 2,
                    child: Row(
                      crossAxisAlignment: CrossAxisAlignment.stretch,

                      children: [
                        Expanded(
                          flex:1,
                          child: Container(

                            child: Utility.imageFromBase64String(images[4].photo_name),

                          ),
                        ),
                        SizedBox(width: 15,),
                        Expanded(
                          flex:1,
                          child: Container(

                            child: Utility.imageFromBase64String(images[5].photo_name),

                          ),
                        ),
                      ],
                    )
                ),
              ],
            ),
          ),
        ),
      ),
    );
  }
}
